import React from 'react';
import './style.css'; // Импортируйте свой стиль или используйте стили напрямую в компоненте

export default function RegistrationForm() {
  return (
    <div>
      <h1>Форма реєстрації</h1>

      <form action="registration_process.php" method="post" encType="multipart/form-data">
        <label htmlFor="firstname">Ім'я:</label>
        <input type="text" id="firstname" name="firstname" required />

        <label htmlFor="lastname">Фамілія:</label>
        <input type="text" id="lastname" name="lastname" required />

        <label htmlFor="age">Вік (від 18 до 60):</label>
        <input type="number" id="age" name="age" min="18" max="60" required />

        <label htmlFor="gender">Стать:</label>
        <select id="gender" name="gender" required>
          <option value="male">Чоловік</option>
          <option value="female">Жінка</option>
        </select>

        <label htmlFor="military_branch">Рід військ:</label>
        <select id="military_branch" name="military_branch" required>
          <option value="army">Сухопутні війська</option>
          <option value="navy">Повітряні сили</option>
          <option value="air_force">Військово-морські сили</option>
        </select>

        <label htmlFor="rank">Звання:</label>
        <select id="rank" name="rank" required>
          {/* ... вставьте опции звань з вашего HTML-кода */}
        </select>

        <label htmlFor="photo">Додати фото:</label>
        <input type="file" id="photo" name="photo" accept="image/*" required />

        <button type="submit">Зареєструватися</button>
      </form>

      <p>Вже маєте аккаунт? <a href="login.html">Увійдіть тут</a>.</p>
      <a href="index.html" id="registration-link">На головну</a>

      <script>
        {`
          document.addEventListener("DOMContentLoaded", function () {
              var registrationLink = document.getElementById("registration-link");

              registrationLink.addEventListener("click", function (event) {
                  // Перенаправлення на сторінку реєстрації
                  window.location.href = "regestr.html";
              });
          });
        `}
      </script>
    </div>
  );
}
